impl FromXml for Run {
    fn from_xml<R: BufRead>(
        reader: &mut Reader<R>,
        start_tag: &BytesStart,
        is_empty: bool,
    ) -> Result<Self, ParseError> {
        #[cfg(feature = "wml-track-changes")]
        let mut f_rsid_r_pr = None;
        #[cfg(feature = "wml-track-changes")]
        let mut f_rsid_del = None;
        #[cfg(feature = "wml-track-changes")]
        let mut f_rsid_r = None;
        #[cfg(feature = "wml-styling")]
        let mut f_r_pr = None;
        let mut f_run_content = Vec::new();
        #[cfg(feature = "extra-attrs")]
        let mut extra_attrs = std::collections::HashMap::new();
        #[cfg(feature = "extra-children")]
        let mut extra_children = Vec::new();
        #[cfg(feature = "extra-children")]
        let mut child_idx: usize = 0;

        // Parse attributes
        for attr in start_tag.attributes().filter_map(|a| a.ok()) {
            let val = String::from_utf8_lossy(&attr.value);
            match attr.key.local_name().as_ref() {
                #[cfg(feature = "wml-track-changes")]
                b"rsidRPr" => {
                    f_rsid_r_pr = decode_hex(&val);
                }
                #[cfg(feature = "wml-track-changes")]
                b"rsidDel" => {
                    f_rsid_del = decode_hex(&val);
                }
                #[cfg(feature = "wml-track-changes")]
                b"rsidR" => {
                    f_rsid_r = decode_hex(&val);
                }
                #[cfg(feature = "extra-attrs")]
                unknown => {
                    let key = String::from_utf8_lossy(attr.key.as_ref()).into_owned();
                    extra_attrs.insert(key, val.into_owned());
                }
                #[cfg(not(feature = "extra-attrs"))]
                _ => {}
            }
        }

        // Parse child elements
        if !is_empty {
            let mut buf = Vec::new();
            loop {
                match reader.read_event_into(&mut buf)? {
                    Event::Start(e) => {
                        match e.local_name().as_ref() {
                            #[cfg(feature = "wml-styling")]
                            b"rPr" => {
                                f_r_pr =
                                    Some(Box::new(RunProperties::from_xml(reader, &e, false)?));
                                #[cfg(feature = "extra-children")]
                                {
                                    child_idx += 1;
                                }
                            }
                            b"br"
                            | b"t"
                            | b"contentPart"
                            | b"delText"
                            | b"instrText"
                            | b"delInstrText"
                            | b"noBreakHyphen"
                            | b"softHyphen"
                            | b"dayShort"
                            | b"monthShort"
                            | b"yearShort"
                            | b"dayLong"
                            | b"monthLong"
                            | b"yearLong"
                            | b"annotationRef"
                            | b"footnoteRef"
                            | b"endnoteRef"
                            | b"separator"
                            | b"continuationSeparator"
                            | b"sym"
                            | b"pgNum"
                            | b"cr"
                            | b"tab"
                            | b"object"
                            | b"pict"
                            | b"fldChar"
                            | b"ruby"
                            | b"footnoteReference"
                            | b"endnoteReference"
                            | b"commentReference"
                            | b"drawing"
                            | b"ptab"
                            | b"lastRenderedPageBreak" => {
                                f_run_content.push(RunContent::from_xml(reader, &e, false)?);
                                #[cfg(feature = "extra-children")]
                                {
                                    child_idx += 1;
                                }
                            }
                            #[cfg(feature = "extra-children")]
                            _ => {
                                // Capture unknown element for roundtrip
                                let elem = RawXmlElement::from_reader(reader, &e)?;
                                extra_children.push(PositionedNode::new(
                                    child_idx,
                                    RawXmlNode::Element(elem),
                                ));
                                child_idx += 1;
                            }
                            #[cfg(not(feature = "extra-children"))]
                            _ => {
                                // Skip unknown element
                                skip_element(reader)?;
                            }
                        }
                    }
                    Event::Empty(e) => {
                        match e.local_name().as_ref() {
                            #[cfg(feature = "wml-styling")]
                            b"rPr" => {
                                f_r_pr = Some(Box::new(RunProperties::from_xml(reader, &e, true)?));
                                #[cfg(feature = "extra-children")]
                                {
                                    child_idx += 1;
                                }
                            }
                            b"br"
                            | b"t"
                            | b"contentPart"
                            | b"delText"
                            | b"instrText"
                            | b"delInstrText"
                            | b"noBreakHyphen"
                            | b"softHyphen"
                            | b"dayShort"
                            | b"monthShort"
                            | b"yearShort"
                            | b"dayLong"
                            | b"monthLong"
                            | b"yearLong"
                            | b"annotationRef"
                            | b"footnoteRef"
                            | b"endnoteRef"
                            | b"separator"
                            | b"continuationSeparator"
                            | b"sym"
                            | b"pgNum"
                            | b"cr"
                            | b"tab"
                            | b"object"
                            | b"pict"
                            | b"fldChar"
                            | b"ruby"
                            | b"footnoteReference"
                            | b"endnoteReference"
                            | b"commentReference"
                            | b"drawing"
                            | b"ptab"
                            | b"lastRenderedPageBreak" => {
                                f_run_content.push(RunContent::from_xml(reader, &e, true)?);
                                #[cfg(feature = "extra-children")]
                                {
                                    child_idx += 1;
                                }
                            }
                            #[cfg(feature = "extra-children")]
                            _ => {
                                // Capture unknown empty element for roundtrip
                                let elem = RawXmlElement::from_empty(&e);
                                extra_children.push(PositionedNode::new(
                                    child_idx,
                                    RawXmlNode::Element(elem),
                                ));
                                child_idx += 1;
                            }
                            #[cfg(not(feature = "extra-children"))]
                            _ => {}
                        }
                    }
                    Event::End(_) => break,
                    Event::Eof => break,
                    _ => {}
                }
                buf.clear();
            }
        }

        Ok(Self {
            #[cfg(feature = "wml-track-changes")]
            rsid_r_pr: f_rsid_r_pr,
            #[cfg(feature = "wml-track-changes")]
            rsid_del: f_rsid_del,
            #[cfg(feature = "wml-track-changes")]
            rsid_r: f_rsid_r,
            #[cfg(feature = "wml-styling")]
            r_pr: f_r_pr,
            run_content: f_run_content,
            #[cfg(feature = "extra-attrs")]
            extra_attrs,
            #[cfg(feature = "extra-children")]
            extra_children,
        })
    }
}

